import React from 'react'
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    texttitle: {
        fontSize: '22.6px',
        fontWeight: 'bold',
        color: '#4A4A4A'
    },
    subTitle: {
        fontSize: '19.4px',
        color: '#4A4A4A',
        fontWeight: 'bold'

    },
    frame: {
        width: "554px",
        height: "336px",
        backgroundColor: "#FFFFFF",
        position: "relative"

    },
    inner: {
        width: "464px",
        height: "249px",
        background: "red",
        position: "relative",
        margin: 'auto'
    },
    superinner: {
        width: "363px",
        height: "170.6px",
        background: "blue",
        position: "absolute",
        margin: 'auto',
        bottom: 0
    }
}))

export default function DialogDetail() {
    const classes = useStyles()
    return (
        <div className={classes.frame}>
            <div style={{ height: 44 }} />
            <div className={classes.inner}>
                <div className={classes.superinner}>

                </div>
            </div>
        </div>
    )
}
